import pandas as pdimport numpy as npimport matplotlib.pyplot as pltimport seaborn as snsfrom sklearn.datasets import load_linnerudfrom sklearn.model_selection import train_test_splitfrom sklearn.tree import DecisionTreeRegressordata = load_linnerud()diabetes = pd.DataFrame(data.data, columns=data.feature_names)x = diabetesy = data.targetregressor = DecisionTreeRegressor(random_state=101)regressor.fit(x, y)predictor = regressor.predict(x)print(y)print(predictor)# eval = pd.DataFrame({'prediction':predictor, 'Actual Test':})# print(eval)